import './HomePage.scss';

import '../../assets/pictures/profile.jpeg'

function HomePage () {

    return(
        <main className="home">
            <div className="home__profile">
                <div className="home__profile-img-container">
                    <img className="home__profile-img" src="" alt="profile"/>
                </div>
            </div>

        </main>
    )
}

export default HomePage;
